    function on_search() {
        let result = document.getElementById('search-result');
        let searchbox = document.getElementById('search-box');
        let search_result = [];
        if (searchbox.value != "") {
            for (let node of nodes.get()) {
                if (String(node.id).includes(searchbox.value) || node.label.toLowerCase().includes(searchbox.value)) {
                    if (search_result.length < 3) {
                        search_result.push(node);
                    }
                    else { break; }
                }
            }
        }
        result.innerHTML = "";
        for (let node of search_result) {
            let ntext = document.createTextNode(node.label);
            let ndiv = document.createElement("div");
            ndiv.onclick = function() {
                select_node(node.id);
                searchbox.value = "";
                result.innerHTML = "";
            };
            ndiv.appendChild(ntext);
            result.appendChild(ndiv);
        }
    }
    function on_node_deselect(params) {
        var popup = document.getElementById('tooltip-popup');
            if (params.nodes.length == 0) {
                popup.innerHTML = "";
                popup.style.display = "none";
                undo_highlight_neighbours();
            }
        }
    function on_node_select(params) {
        var popup = document.getElementById('tooltip-popup');
        if (params.nodes.length != 0) {
            popup.innerHTML = nodes.get(params.nodes[0]).title;
            popup.style.display = "block";
            highlight_neighbours(params.nodes[0]);
        }
    }
    function select_node(nid) {
        network.selectNodes([nid]);
        network.focus(nid);
        on_node_select(
            {nodes: [nid]}
        )
    }
    function highlight_neighbours(selected) {
        let nodes_distance = {[selected]: 0};
        let queue = [selected];
        while (queue.length > 0) {
            let item = queue.shift();
            for (let nbr of network.getConnectedNodes(item)) {
                if (nodes_distance[nbr] == undefined) {
                    nodes_distance[nbr] = nodes_distance[item] + 1;
                    queue.push(nbr);
                }
            }
        }
        function node_color(distance) {
            switch(distance) {
                case 0:
                    return "#97c2fc";
                    break;
                case 1:
                    return "#62f065";
                    break;
                case 2:
                    return "#c0f59f";
                    break;
                case 3:
                    return "#f7db92";
                    break;
                case 4:
                    return "#db833b";
                    break;
                case 5:
                    return "#f2877c";
                    break;
                default:
                    return "#a30000";
            }
        }
        for (let node of nodes.get()) {
            distance = nodes_distance[node.id]
            node.color = node_color(distance);
            nodes.update(node);
        }
    }
    function undo_highlight_neighbours() {
        for (let node of nodes.get()) {
            node.color = "#97c2fc";
            nodes.update(node);
        }
    }

1..16, p)   Prepend x times before announcing to ASp.\nremarks:            Custom communities for debugging assistance:\nremarks:            - (4242420119, 1000, n)    Route entered AS4242420119 on node n.\nremarks:            - (4242420119, 2000, n)    Route left AS4242420119 on node n.\nremarks:            \nremarks:            Please note that the registry data has to be up to date or your routes will fail the checks. Only strict ROA and basic path validation is performed at the moment but full path validation is planned for the future.\nremarks:            \nmp-import:          afi any.unicast from AS4242420119:AS-TRANSIT accept ANY\nmp-export:          afi any.unicast to AS4242420119:AS-TRANSIT announce ANY\nmp-import:          afi any.unicast from AS4242420119:AS-PEER accept PeerAS\nmp-export:          afi any.unicast to AS4242420119:AS-PEER announce AS4242420119\nmp-import:          afi any.unicast from AS4242420119:AS-DOWNSTREAM accept PeerAS\nmp-export:          afi any.unicast to AS4242420119:AS-DOWNSTREAM announce ANY\nmp-import:          afi any.unicast from AS4242420119:AS-UPSTREAM accept ANY\nmp-export:          afi any.unicast to AS4242420119:AS-UPSTREAM announce AS4242420119 AS4242420119:AS-DOWNSTREAM\nsource:             DN42\n\u003c/pre\u003e"}, {"id": 4242422547, "label": "LANTIAN-AS", "shape": "dot", "size": 20.860707930586734, "title": "\u003cp\u003e\u003c/p\u003e\u003cdiv\u003eAS4242422547 LANTIAN-AS\u003c/div\u003e\u003cdiv\u003erank: 18\u003c/div\u003e\u003cdiv\u003ecentrality: 20.8607\u003c/div\u003e\u003cdiv\u003ecloseness: 0.4817\u003c/div\u003e\u003cdiv\u003ebetweenness: 0.0175\u003c/div\u003e\u003cdiv\u003epeer count: 81\u003c/div\u003e\u003cp\u003e\u003c/p\u003e\u003cdiv\u003ePeer list:\u003c/div\u003e\u003cp\u003e\u003c/p\u003e\u003cdiv onclick=\"select_node(4242420233);\"\u003eAS-ZEROWOLF-DN42\u003c/div\u003e\u003cdiv onclick=\"select_node(4242421771);\"\u003eAS-DUSTSTARS-DN42\u003c/div\u003e\u003cdiv onclick=\"select_node(4242421789)             "enabled": true,
            "fit": true,
            "iterations": 1000,
            "onlyDynamicEdges": false,
            "updateInterval": 50
        }
    }
};

        options.layout = {
            improvedLayout: false
        }
        options.edges.color = "rgba(43,124,233,0.42)";

        options.nodes = {
            color: "#97c2fc",
            shadow: {
                enabled: true,
                size: 8,
                x: 1,
                y: 1
            }
        }

        options.physics.barnesHut = {
            gravitationalConstant: -14400,
            springLength: 235
        }
        options.physics.minVelocity = 0.75;

        

        

        network = new vis.Network(container, data, options);

        


        
        network.on("stabilizationProgress", function(params) {
      		document.getElementById('loadingBar').removeAttribute("style");
	        var maxWidth = 496;
	        var minWidth = 20;
	        var widthFactor = params.iterations/params.total;
	        var width = Math.max(minWidth,maxWidth * widthFactor);

	        document.getElementById('bar').style.width = width + 'px';
	        document.getElementById('text').innerHTML = Math.round(widthFactor*100) + '%';
	    });
	    network.once("stabilizationIterationsDone", function() {
	        document.getElementById('text').innerHTML = '100%';
	        document.getElementById('bar').style.width = '496px';
	        document.getElementById('loadingBar').style.opacity = 0;
            document.getElementById('search-area').style.display = "block";
	        // really clean the dom element
	        setTimeout(function () {document.getElementById('loadingBar').style.display = 'none';}, 500);

            let node = new URL(window.location).searchParams.get("node");
            if (node) {
                node = Number(node);
                if (Number.isInteger(node) && nodes.get(node)) {
                    select_node(node);
                }
            }
	    });
        network.on('deselectNode', on_node_deselect);
        network.on('selectNode', on_node_select);
        

        return network;

    }

    drawGraph();

</script>
</body>
</html>
